import React, { Component  } from "react";
import LoginPage from "./Page/LoginPage/LoginPage";


import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";


class App extends Component {

  render(){
    return (

      <div className="App">
        <Router>

            <Route path="/">
              <LoginPage />
            </Route>

        </Router>

    </div>
  );
  }
}

export default App;
